import './Profile.css';

const Profile = () => {
    return (
        <div className='profile'>
        <img className='cat' src='https://instagram.fiev22-1.fna.fbcdn.net/v/t51.2885-19/275969474_973819100194124_6504116150353198404_n.jpg?stp=dst-jpg_s150x150&_nc_ht=instagram.fiev22-1.fna.fbcdn.net&_nc_cat=108&_nc_ohc=flIqHhObT4MAX-Fsk1-&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT9c8ErwZF9i6j278wSBJv16jJUmES8PpUGg6q0lb0lqXA&oe=625FC6C4&_nc_sid=7bff83'></img>
       <div className='about'>
        <h2>Vlad Zavalii</h2>
        <p>Age: 16</p> 
        <p>City: Kyiv, Ukraine</p>
        <p>About me: I like sport so much.
        2 years of tennis and 7 years of karate </p>
       
        </div>
        </div>
    );
}

export default Profile;
